<!DOCTYPE html>
<html style="overflow: hidden; height: 100% ; width: 100% ;">
    <head>
        <title>MenuDirectorWI</title>
        <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
        <link type="text/css" rel="stylesheet" href="styles.css">
        
        <script type="text/javascript">
            <!--
            function timedRefresh(timedoutperiod) {
                setTimeout("location.reload(true);", timedoutperiod);
            }
            //-->
        </script>
    
    </head>
    <body style="overflow: hidden; height: 100% ; width: 100% ;"  onload="Javascript:timedRefresh(5000);">
        <div class="v-app v-theme-ag v-app-ViewerApplication">
            <div class="v-view" >
                <div class="v-csslayout MenuDirectorWI">
                    <button class="v-nativebutton MenuDirector_UserAccountsWI_B" type="button">
                        <span class="v-nativebutton-caption">MenuDirector_UserAccountsWI_B</span>
                    </button>
                    <button class="v-nativebutton MenuDirector_ConfigurationWI_B" type="button">
                        <span class="v-nativebutton-caption">MenuDirector_ConfigurationWI_B</span>

                        <span class="v-nativebutton-caption">MenuDirector_FoodRegimesWI_B</span>

                        <span class="v-nativebutton-caption">MenuDirector_ContractsWI_B</span>
                    </button>
                    <button class="v-nativebutton MenuDirector_ChangePasswordWI_B" type="button">

                    <button class="v-nativebutton MenuDirector_CountMealsWI_B" type="button">

                    </button>
                    <button class="v-nativebutton Menu_Director_Back_B" type="button">
                        <span class="v-nativebutton-caption">Menu_Director_Back_B</span>
                    </button>
                </div>
            </div>
        </div>
    </body>
</html>
